INSERT INTO `incidents` (`id`, `user_id`, `employee_id`, `sel_involved`, `involved`, `type`, `inc_category`, `insurance`, `wps`, `severity`, `injury_location`, `injury_sustain`, `cause`, `equipment`, `description`, `action`, `status`, `docs`, `location`, `date`, `created_at`, `updated_at`) VALUES
('IAAINR-001', '0d68fe6e-9601-44de-93e7-4ee18f553a9d', 2454, 'Employee', '30036338 - Osama Eid Mohamed Kheriba, 30039590 - Abadhesh Kumar Karna, 30039698 - Ram Kumar Yadav, 31034662 - Afaj Uddin', 'MTC', 'Work Related', 'Non GOSI', '4', '3', 'Fingers/Thumb', 'Crush Injury', 'Lack of Task Skill, Lack of Supervision, Not Paying Attention, Human Error, Inadequate PPE', 'Static Plant Equipment', 'During soil compaction work in excavation # 08 at site3 [Support Facilities] Mr.Afaj Uddin was using mini roller compactor for soil Compaction. During operation of compactor in a reverse mode suddenly Mr. Afaj Uddin did not managed the control of compactor, as a result his left ring finger cursed between compactor handle and concrete manhole and got injury.', 'Stop the work and injured person sent to firs aid room for immediate treatment and further Medical Attention at hospital.', 0, 'NGprUwYKCbHvhs69y9AEpgXIcsPoTzKSrLTUhSE8.pdf', 12, '2020-11-22 08:30:00', '2020-11-23 21:52:04', '2020-11-23 21:52:04'),
('IAAINR-002', 'b367a71b-a00f-49b1-8421-cf78b44e33e2', 1554, 'Employee', '30036474 - Moukhtar Hamed Mohamed Ali, 30038574 - Ikbal Kazi', 'First Aid', 'Work Related', 'Non GOSI', '2', '2', 'Fingers/Thumb', 'Cut/Laceration', 'Not Paying Attention, Knives/Sharps', 'Structure', 'Mr.Moukthar Hamed was assigned for removing the debris from excavated area(60cm depth) adjacent to the demolished structure of housing .While removing the debris using shovel, his left hand thumb finger was hit the corroded sharp steel from the demolished structure resulted with small laceration on his thumb finger', 'Given first Aid at office clinic\r\nInstructed to cut the protruding steels once the demolition job was done', 1, 'jTDdMy5Aa3GcUNn709b5gOsAzkABb04fJKIShvN7.docx', 10, '2020-11-24 10:00:00', '2020-11-24 23:47:12', '2020-11-24 23:47:12'),
('IAAINR-003', 'ee0fb62c-a79f-442e-b49e-2e826e899fdd', 2420, 'Employee', '44065186 - Maqbool Hussain', 'First Aid', 'Work Related', 'Non GOSI', '2', '3', 'Fingers/Thumb', 'Scalping', 'Lack of Supervision, Human Error', 'None', 'Maqbool Hussain (Steel fixer) (injured person) was doing steel bending work with the help of steel bending rod (two heads iron bar bender) (as shown in picture). While doing so he applied significant force on the steel bending rod to bend the steel rebar, suddenly the rod slipped from the steel and hit the floor. His right hand thumb pinched in between rod and ground.\r\n\r\nHis thumb skin got scalped. He was given first aid in the site’s first aid room.\r\n\r\nHe was wearing the gloves at the time of the incident.', 'He was given first aid immediately in the site’s first aid room.\r\n\r\nAdvised foreman to use the steel pipe of relevant size instead of this rod to bend the steel. Right tool must be used. Avoid usage of homemade tools.\r\n\r\nAdvised workers to ensure proper alignment of the rod with the steel rebar to avoid slipping. And the two heads must be extended to avoid chances of slipping.\r\n\r\nAdvised steel fixers to hold the rod from appropriate position to avoid pinching injuries.\r\n\r\nUse good quality hand gloves all the times.', 0, 'T0WlT9dhlSKeZm5vzSelwkHK3JFPnsHtKh0DxUgY.docx', 12, '2020-11-01 11:25:00', '2020-12-03 21:49:51', '2020-12-03 21:49:51'),
('IAAINR-005', 'ee0fb62c-a79f-442e-b49e-2e826e899fdd', 1959, 'Employee', 'Mohammed Said, Ibrahim', 'Near Miss', 'Work Related', 'Non GOSI', '4', '1', 'None', 'None', 'Safety Rule Violated, Lack of Supervision, Not Paying Attention, Human Error', 'Scaffold', 'Sub-con worker was doing beams de-shuttering on the scaffolding platform in the multipurpose area. While removing and keeping the material on the platform, one timber fell from the top of the guard rail from a height of 12m and fell onto the worker working downside on the ground. The timber hit his shoulder and helmet. No injury was reported.', '•	Person standing below was taken to the first aid room and was checked by the nurse. There was no injury.\r\n•	Parallel activities must not be allowed nearby.\r\n•	Stopped the work and toolbox talk was given regarding the near miss.\r\n•	Instructed foreman to barricade the area beneath the working platform and no one must be allowed to stand under the working scaffolding structure.\r\n•	Extra and loose materials must not be stacked on the top of the platform or gaur rails.', 0, 'rve4YQ7veI4rmLAahtqVcGNTkGSyv0j59B1xOWk1.docx', 12, '2020-11-04 10:30:00', '2020-12-03 22:08:59', '2020-12-03 22:08:59'),
('IAAINR-006', 'ee0fb62c-a79f-442e-b49e-2e826e899fdd', 1991, 'Employee', 'Mahmood-(Welder)', 'First Aid', 'Work Related', 'Non GOSI', '2', '3', 'Fingers/Thumb', 'Scalping', 'Knives/Sharps', 'Press drill', 'The IP was engaged in the fabrication activity, he was making holes in the steel angles using press drill. While doing so the wooden support from the bottom of the steel jerked due to the movement of drill bit and his left hand glove came in contact with the drill bit, got entangled and pulled the hand towards the drill bit. Left hand middle finger got hit with the drill bit and the finger’s skin was scalped slightly. The IP stopped the machine immediately by pressing the stop button. He went to site’s first aid room where he received first aid.', 'Vice must be used to tighten the wooden support.\r\nLoose gloves must not be used, skin tight anti cut gloves must be used.\r\nIncident was investigated, and fabrication team was advised to place hands further away from the drill bit.', 0, 'zUzjxgIoCfNsdXNDOfGdGFFmpWOE7oJG94wX10fA.docx', 12, '2020-11-18 09:30:00', '2020-12-03 22:24:16', '2020-12-03 22:24:16'),
('IAAINR-007', 'ee0fb62c-a79f-442e-b49e-2e826e899fdd', 1566, 'Employee', '31035830 - Abid Hussain', 'Near Miss', 'Work Related', 'Non GOSI', '4', '3', 'None', 'None', 'Poor Weather Conditions, Heavy Equipment', 'Plant Equipment, None', 'At 18-Nov-2020 around 09:32, am our RCL operator name Abid Hossain Badge # 31035830 was operating the Backhoe with plate# 4567 AAA. And was  going to gate # 7 from Turn around area but while going to gate #7 suddenly wind speed become high and because of high wind speed left side window closed with high impact and due to this high impact window mirror broken.', '•	Operator informed to rcl safety and stopped backhoe\r\n•	Project manager has been informed  about this\r\n•	Operator was suggested to park the backhoe rcl lay down until further notice \r\n•	Operator was suggested not open window during operating backhoe', 0, 'OWDWiyovK1tfIkCAc9e3zmEG6QueG83HVf1rH2BJ.docx', 3, '2020-11-18 09:32:00', '2020-12-03 23:22:21', '2020-12-03 23:22:21'),
('IAAINR-008', '0d68fe6e-9601-44de-93e7-4ee18f553a9d', 2493, 'Employee', '30039939 - Rajendra BK, 30040664 - Satydev Yadav, 31034537 - Abdur Rahman, 44066815 - Kiran Chaudhary Tharu, 31037321 - Puran Chaudhary', 'First Aid', 'Work Related', 'Non GOSI', '2', '2', 'Fingers/Thumb', 'Crush Injury', 'Lack of Task Skill, Lack of Supervision, Improper Lifting (MH), Not Paying Attention, Human Error, Lack of Task Knowledge, Poor Team Work', 'Scaffold', 'Auditorium part 1 while working in dismantling scaffolding, IP is receiving the dismantled scaffolding tube from the 3rd level and while receiving the tube in his level (2nd) he couldn\'t control the tube and tube hit to another scaffolding tube and his left ring finger crush between two scaffolding tube\'s while receiving the scaffold bars.', 'Stop the work and injured person sent to firs aid room for immediate treatment and further Medical Attention', 0, 'lSpHaXqHnGpkHA5aVktmbZ8LvlxRQ7w5IiB27mUB.docx', 12, '2020-12-04 12:00:00', '2020-12-05 18:16:41', '2020-12-14 22:02:06'),
('IAAINR-009', '10ce5e95-be62-4269-9493-ec8c947c3957', 2854, 'Employee', '30038915 - Pedro Gomes Manuel Rosario', 'Property Damage', 'Work Related', 'Non GOSI', 'None', 'None', 'None', 'None', 'Not Paying Attention, Human Error', 'Light Vehicle', 'While reversing the Hiace (RTE No: 1567) was struck against the column of the parking shade, which is located at its backside. There is no damage on the column but rear window glass of the HIACE was broken completely.', 'Allocate the designated parking area for the vehicles at all school sites, where the one-way route system is not possible', 0, 'PZbDC33Yn53xt8GeFNDCcHl9kp9muwrASnYa1zT4.pdf', 25, '2020-12-06 11:00:00', '2020-12-06 20:28:13', '2020-12-06 21:11:45'),
('IAAINR-010', '0d68fe6e-9601-44de-93e7-4ee18f553a9d', 2506, 'NonEmployee', 'Walid Magdy Lofty Seifel Nass', 'First Aid', 'Work Related', 'Non GOSI', '3', '3', 'Hand', 'Cut/Laceration', 'Lack of Supervision, Not Paying Attention, Lack of Task Knowledge', 'None', 'While doing the shuttering work in part-3 stair case, the sub-con worker (IP-Waleed) finished fixing one piece of timber and tried to turn back to take another timber, at that time his right hand got hit with the steel binding wire that was protruding from the steel structure (as shown in the picture). \r\n\r\nHe got a cut in his hand right hand.\r\n\r\nHe was given first aid in site’s first aid room.', 'First aid was given to the IP. \r\n\r\nIncident was discussed with the sub-con team.\r\n\r\nAll binding wires must be bended and sharp edges must be covered before start of work.\r\n\r\nAccess must be ensured clear of all the sharp edges.\r\n\r\nFull sleeves coverall and proper PPEs must be worn for all construction activities.', 0, 'kKxZrIUnV6cdUjBXkppaqX9SExz8ZFMXkGyO4fFG.pdf', 12, '2020-12-08 12:00:00', '2020-12-09 17:38:25', '2020-12-14 21:57:01'),
('IAAINR-011', '247fdc70-7b58-4de1-a4bb-db360e3edff4', 310, 'Employee', '30038976 - Khokan Mondal', 'First Aid', 'Work Related', 'Non GOSI', '2', '2', 'Ankle/Foot', 'Scalping', 'Poor Housekeeping', 'None', 'Khokan Mondal (IP) was doing shuttering work at elevated Scaffolding platform. IP was involved in shifting wooden timber from one place to another on scaffold platform, during this movement, he placed his right foot on plywood which had protruded nail and slightly punctured his right foot.', 'Always keep access and egress clear at workplace. Reuse of wooden material should be denailed on ground at designated workplace. Ensure good housekeeping at work place and potentially harmful protruded objects should be removed or covered.', 1, NULL, 12, '2020-09-09 09:00:00', '2020-12-13 21:02:39', '2020-12-13 21:02:39'),
('IAAINR-012', '0d68fe6e-9601-44de-93e7-4ee18f553a9d', 1959, 'Employee', '30037748 - Mahboob Ali', 'First Aid', 'Work Related', 'Non GOSI', '3', '3', 'Face, Knee', 'Bruising', 'Not Paying Attention', 'None', 'Around 9.00 AM Mr. Mahaboob Ali was discussing with his foreman in swimming pool front side area Where there is some bended rebar’s dowels (Bended parallel to the ground) after finishing his discussion he turn back to the work location at that time unfortunately his both foot stuck with rebar’s dowels and fell down on the ground, resulting small scratches and inflammation on his face (left Eyebrow) and his left and right leg knee.', 'Immediately sent him to first aid room and given first aid all the rebar’s dowels rearranged in vertical position and provide the warning tape on the rebar’s for the visibility', 0, '27OcNCrcuGtBuc7dIkPtamowZmt7lrdWcHE38jcl.pdf', 12, '2020-12-14 09:00:00', '2020-12-14 22:01:28', '2020-12-14 22:01:28');
