('IIR-001', 'IAAINR-002', 1554, 'ee0fb62c-a79f-442e-b49e-2e826e899fdd', 10, '2020-11-24', 'PPE,s', '1463', '1999', 'RC Housing Area', 'Occupational', 'First Aid', 'Mr.Moukthar Hamed was assigned for removing the debris from excavated area(50cm depth) after the demolition work adjacent to the building side wall. While removing the debris using shovel, his left-hand thumb finger was hits nearby corroded sharp steel from the demolished structure resulted with small cut on his thumb finger. Immediately First Aid was given from the camp clinic.', 'THUMB FINGER (Left Hand)', 'Yes', 3482, 'No', NULL, NULL, 'No', NULL, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Yes', 'Yes', 'Hand Gloves (Cotton)', 'Removing the debris from the excavation.', 'N/A', 'N/A', '•	Not pay Attention\r\n•	Knives/Sharp- edged steels', 1, 'Yes', 'Employee', '30038574-IKBAL KAZI YAKUB', 'When I demolished the structure wall and Moukhtar was started to remove the debris from the excavated area using shovel where his left-hand thumb finger strikes the steel and get injured.', NULL, 'ulijCKpZ1jrO80R6xRelOmX8nztczy7am6YKXrhO.jpeg', 'Y2U93PTCCJOS3bQR3AvefIxNxWWE98TSiplk5PiV.docx', '2020-11-30 22:13:53', '2020-11-30 22:13:53'),
('IIR-003', 'IAAINR-001', 2454, '0d68fe6e-9601-44de-93e7-4ee18f553a9d', 12, '2020-05-02', 'Induction', '759', '310', 'Support Facilities (Area 3)', 'Occupational', '-', 'During soil compaction work in excavation # 8 Mr.Afraj Uddin was using mini roller compactor for soil compaction during operation of compactor suddenly Mr.Afraj uddin did not managed the controls of compactor, as a result his left ring finger crushed between compactor handle and concrete catch basin and got injury', 'Left ring finger crushed', 'Yes', 1599, 'No', NULL, NULL, 'Yes', 3, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Yes', 'No', NULL, 'Compaction of soil by using mini roller compactor', 'Compaction of soil', '-', 'not paid proper attention to control the mini roller compactor', 0, 'Yes', 'Employee', 'Ram kumar Yadav', 'During compaction work Mr.Afraj was operating compactor but suddenly he did not managed control on operating level and crushed his ring finger with concrete manhole.', 'rtczZPbBb7VZzMoPjIdcwXizUJmLgJVkS7Jvdzv2.jpeg|QoRlI68PXN8NRLekofTzB8mPo2NKU2YQDaRhcCJb.jpeg|WsZbp8URMU1EOMKRMW79DbbmbVv45d8raNZ6m0lv.jpeg', 'oDxogsax8MnixVUGAR757YcODC5JvOlPXgCRqg3J.jpeg|g95chRCdJPD6j24Z3GkhAvwCi5g4moM80k4s7TVy.jpeg', 'bbnFdf130xr5XG8KBiO4VuknmFGPpZ3moRex8sHF.pdf', '2020-12-07 22:51:35', '2020-12-07 22:51:35'),
('IIR-004', 'IAAINR-011', 310, '247fdc70-7b58-4de1-a4bb-db360e3edff4', 12, '2020-10-15', 'Induction Register', '1907', '29', 'Area 3', 'Occupational', 'None', 'Khokan Mondal (IP) was doing shuttering work at elevated Scaffolding platform. IP was involved in shifting wooden timber from one place to another on scaffold platform, during this movement, he placed his right foot on plywood which had protruded nail and slightly punctured his right foot.', 'Right foot slightly punctured.', 'Yes', 1599, 'No', NULL, NULL, 'No', NULL, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Yes', 'Yes', 'Safety Shoes, Safety Goggles, Helmet, Vest, Gloves', 'Shuttering works', 'None', 'Timbers with protruding nails lying on the platform.', 'Protruding nail got hit the right food of the IP', 0, 'No', NULL, NULL, NULL, 'NzeREJQmrFdkW8eOs7GCYJjyBB9yS3JFi3DdhYHr.jpeg|xMAODNvFvElHX0OzQe7d9uBiZ5gDk5JVxSVC1UJp.jpeg|QuoeaoCG4qf3uKAWcLrVIVH1rDncThHpElKadgSo.jpeg', 'ZKQODiirEAfReOBOsle37LWGtWrHSi6vek2XxJnc.jpeg', 'mr21V0R6vdAdYQZOFTfDOuy3rsHoTMa4wDcO76TR.docx', '2020-12-13 22:35:50', '2020-12-13 22:35:50');
