(4, 'IIR-001', 'ee0fb62c-a79f-442e-b49e-2e826e899fdd', 'IAAINR-002', 'Fail to notice the sharp steel from the adjacent demolished structure', 'People', 'Instructed to cut (eliminate the hazard) the corroded steels once demolition work completed', 'Elimination', 1, '2020-11-30 22:13:59', '2020-12-03 14:02:48'),
(5, 'IIR-001', 'ee0fb62c-a79f-442e-b49e-2e826e899fdd', 'IAAINR-002', 'Fail to cut the corroded steels once demolition work completed.', 'Process', 'Refresher training on pre- inspection of Workplace hazards before start of job.', 'Administrative Control', 1, '2020-11-30 22:13:59', '2020-12-03 14:03:01'),
(6, 'IIR-001', 'ee0fb62c-a79f-442e-b49e-2e826e899fdd', 'IAAINR-002', 'Poor Quality of gloves used at work site', 'Equipment', 'Quality of gloves need to be changed where it is addressed to management to change from cotton gloves to rubber coated gloves.', 'PPE Control', 1, '2020-11-30 22:13:59', '2020-12-03 14:03:11'),
(14, 'IIR-003', '0d68fe6e-9601-44de-93e7-4ee18f553a9d', 'IAAINR-001', 'incompetent and untrained person operated the equipment  lack of task skill , poor supervision', 'People', 'Mini roller compactor should be replaced with small plate compactor  ,Trained person should operate the equipment proper supervision should be there. Must use required PPEs (gloves ,ear plugs )Always for work.', 'PPE Control', 0, '2020-12-07 22:51:51', '2020-12-07 22:51:51'),
(18, 'IIR-004', '247fdc70-7b58-4de1-a4bb-db360e3edff4', 'IAAINR-011', 'Skilled workers were present.', 'People', 'De-nailing must be done immediately after de-shuttering.', 'Engineering Control', 0, '2020-12-13 22:35:57', '2020-12-13 22:35:57'),
(19, 'IIR-004', '247fdc70-7b58-4de1-a4bb-db360e3edff4', 'IAAINR-011', 'Anti-puncture safety shoes were not used.', 'Equipment', 'Proper material arrangement and housekeeping must be ensured throughout the day.', 'Administrative Control', 0, '2020-12-13 22:35:57', '2020-12-13 22:35:57'),
(20, 'IIR-004', '247fdc70-7b58-4de1-a4bb-db360e3edff4', 'IAAINR-011', 'Workplace was not OK as it was lacking proper housekeeping.', 'Workplace', 'Safety shoes with steel sole and anti-puncture must be used.', 'PPE Control', 0, '2020-12-13 22:35:57', '2020-12-13 22:35:57');
